--
-- Struttura della tabella `u_rates_u`
--

CREATE TABLE IF NOT EXISTS `u_rates_u` (
  `ID_who_evaluates` int(11) NOT NULL,
  `ID_who_is_evaluated` int(11) NOT NULL,
  `evaluation` int(11) NOT NULL,
  `comment` varchar(140) DEFAULT NULL,
  KEY `fk_who_is_evaluated_idx` (`ID_who_is_evaluated`),
  KEY `fk_who_evaluates` (`ID_who_evaluates`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

--
-- Limiti per le tabelle scaricate
--

--
-- Limiti per la tabella `about`
--
ALTER TABLE `about`
  ADD CONSTRAINT `fk_exercise_about` FOREIGN KEY (`ID_exercise`) REFERENCES `exercise` (`ID`) ON DELETE CASCADE ON UPDATE CASCADE,
  ADD CONSTRAINT `fk_subject_about` FOREIGN KEY (`ID_subject`) REFERENCES `subject` (`ID`) ON DELETE NO ACTION ON UPDATE CASCADE;

--
-- Limiti per la tabella `buys`
--
ALTER TABLE `buys`
  ADD CONSTRAINT `fk_course_bought` FOREIGN KEY (`ID_course`) REFERENCES `course` (`ID`) ON DELETE NO ACTION ON UPDATE CASCADE,
